import React from 'react'
import classes from './Car.module.css'

const Car = props => {

    const cars = [
        {id: 1, name: 'BMW', year: 2018},
        {id: 2, name: 'MERCEDES', year: 2010},
        {id: 3, name: 'VOLKSWAGEN', year: 2012}
    ]

    return (
        <div className={classes.Car}>
            { cars.map((car, index) => {
                return (
                    <h3 key={index}>{car.name}</h3>
                )
            })}
            <h1>Car</h1>
        </div>
    )
}

export default Car
